import React from "react";
import { Card, Nav, Button } from "react-bootstrap";
import { Link } from "react-router-dom";

const NavbarProfile = (props, postSignout) => {
  postSignout = async () => {
    await props.doLogout();
    const isLogin = props.logout;
    console.log("cek islogin", isLogin);
    if (!isLogin) {
      props.history.push("/signin");
    }
  };
  const logOut = async () => {
    await props.doLogout();
  };
  return (
    <Card style={{ width: "20rem" }}>
      <Card.Body className="cardProfile">
        <div className="row">
          <div className="col-8">
            <h6 className="mr-5">Nama User</h6>
            <p>username</p>
          </div>
          <div className="col-2">
            <img
              className="fotoProfile mb-3"
              src={require("../media/desktop.jpeg")}
            />
          </div>
        </div>
        <hr />
        <p>Kembali ke toko</p>
        <hr />
        <h6>Pengaturan akun</h6>
        <Link
          onClick={logOut}
          to="/signin"
          className="dropdown-item"
          style={{ textAlign: "center", color: "white" }}
        >
          <h6>Keluar</h6>
        </Link>
      </Card.Body>
    </Card>
  );
};
export default NavbarProfile;
